import React from 'react';
import ReactFlow, { 
  Background, 
  Controls, 
  MiniMap,
  useNodesState,
  useEdgesState,
  MarkerType,
  Handle
} from 'reactflow';
import 'reactflow/dist/style.css';
import { motion } from 'framer-motion';
import { getCachedServiceIcon } from '../services/IconResolver';

const AWSServiceNode = ({ data }) => (
  <motion.div
    className={`aws-service-node ${data.isMissing ? 'missing' : ''}`}
    initial={{ scale: 0, opacity: 0 }}
    animate={{ scale: 1, opacity: 1 }}
    exit={{ scale: 0, opacity: 0 }}
    whileHover={{ scale: 1.1 }}
    transition={{ type: "spring", stiffness: 300 }}
  >
    <Handle 
      type="target" 
      position="top" 
      id={`${data.id}-target`}
      className="handle"
    />
    <div className="node-content">
      {data.isMissing ? (
        <div className="missing-service-placeholder">
          <span>?</span>
        </div>
      ) : (
        <img src={data.icon} alt={data.label} className="service-icon" />
      )}
      <span className="service-label">{data.label}</span>
    </div>
    <Handle 
      type="source" 
      position="bottom" 
      id={`${data.id}-source`}
      className="handle"
    />
  </motion.div>
);

const nodeTypes = {
  awsService: AWSServiceNode
};

const createNodeId = (serviceName) => {
  return serviceName.toLowerCase().replace(/\s+/g, '-');
};

const AWSArchitectureDisplay = ({ architecture }) => { // removed missingServices prop as it is derived from architecture
  const [nodes, setNodes, onNodesChange] = useNodesState([]);
  const [edges, setEdges, onEdgesChange] = useEdgesState([]);

  React.useEffect(() => {
    if (!architecture?.services) {
      console.log('⚠️ Waiting for architecture data...');
      return;
    }

    const newNodes = architecture.services.map((service) => {
      const serviceId = typeof service === 'string' ? createNodeId(service) : service.id;
      const serviceName = typeof service === 'string' ? service : service.name;
      const serviceIcon = typeof service === 'string' ? getCachedServiceIcon(service) : service.icon;
      const isMissing = typeof service === 'string' && service.startsWith('missing');

      return {
        id: serviceId,
        type: 'awsService',
        position: { x: 0, y: 0 }, // Initial position; ReactFlow will handle layout
        data: {
          label: isMissing ? 'Missing Service' : serviceName,
          icon: serviceIcon,
          isMissing: isMissing,
        },
      };
    });

    const newEdges = architecture.connections.map((conn) => ({
      id: `${createNodeId(conn.from)}-${createNodeId(conn.to)}`,
      source: createNodeId(conn.from),
      target: createNodeId(conn.to),
      sourceHandle: `${createNodeId(conn.from)}-source`,
      targetHandle: `${createNodeId(conn.to)}-target`,
      type: 'smoothstep',
      animated: true,
      style: { stroke: '#4FD1C5', strokeWidth: 2 },
      markerEnd: { type: MarkerType.ArrowClosed },
    }));

    setNodes(newNodes);
    setEdges(newEdges);

  }, [architecture, setNodes, setEdges]);


  if (!architecture?.services) {
    return <div className="architecture-visualizer-loading">Loading...</div>;
  }

  return (
    <div style={{ height: '500px' }} className="architecture-visualizer">
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        nodeTypes={nodeTypes}
        fitView
        minZoom={0.5}
        maxZoom={1.5}
      >
        <Background color="#4FD1C5" gap={16} size={1} />
        <Controls />
        <MiniMap
          nodeColor={(node) => (node.data.isMissing ? '#FF5656' : '#4FD1C5')}
          maskColor="rgba(13, 25, 35, 0.7)"
        />
      </ReactFlow>
    </div>
  );
};

export default AWSArchitectureDisplay;
